import React from 'react';
import ProjectImage from './ProjectImage.js'; 

function NHLAttendance(props) {
    return (
        <div>
          <h1>Project Page</h1>
          <ProjectImage
        link="/NHLAttendance"
        image="./NHLAttendance.gif"
        title="NHL Season Attendance"s
        category="Web App"
        />
        </div>
      )
}



export default NHLAttendance;
